import React from 'react';

function ButtonStart({ onClick, text, hover }) {
  return (
    <button
      disabled={false}
      onClick={onClick}
      className={'btn-start' + hover ? '' : 'no-hover'}
    >
      {text}
    </button>
  );
}

export default ButtonStart;
